import React from 'react'
import PropTypes from 'prop-types'

const petImage = src => {
    console.log(src)

    return (
        <div>
            <img className='profileImage' src={src}/>
        </div>
    )
}

petImage.propTypes = {
src: PropTypes.string.isRequired
}

export default petImage
